function addMaterial( name, map, normalMap, emissiveMap ){

	var material = new THREE.MeshStandardMaterial();
	material.skinning = true; // caution!
	material.metalness = 0;
	material.roughness = 0.5;
	material.color.setHex(0xffffff);
	material.emissive.setHex(0xcccccc);
	material.normalScale.x = material.normalScale.y = 0.5;
	if ( map ) material.map = map;
	if ( name ) material.name = name;
	if ( normalMap ) material.normalMap = normalMap;
	if ( emissiveMap ) material.emissiveMap = emissiveMap;
	material.needsUpdate = true; // important!
	this.push( material );
	return material;

}

