function toJSON( callback ){

	return this.map(function( item ){
		return callback( item );
	});
}

function fromJSON( callback, array ){

	if ( !Array.isArray( array ) ) return;

	return array.map(function( json ){
		return callback( json );
	});
}

function disposeTextures(){

	for ( var i = 0; i < this.length; i++ ) {

		this[i] && this[i].dispose();
	}
}

function disposeMaterials(){

	for ( var i = 0; i < this.length; i++ ) {

		var material = this[i];

		if ( material && material.materials && material.materials.length ) {

			for ( var j = 0; j < material.materials.length; j++ ) {
				material.materials[j] && dispose( material.materials[j] );
			}

		} else {

			material && !material.materials && dispose( material );
		}
	}
}

function dispose( material ){

	material && material.map && material.map.dispose && material.map.dispose();
	material && material.bumpMap && material.bumpMap.dispose && material.bumpMap.dispose();
	material && material.alphaMap && material.alphaMap.dispose && material.alphaMap.dispose();
