groundHelper = this;  

var step = 10;
var size = 1000;
var name = "ground helper";

this.add( new helper(size, step, name) );

function helper(size, step, name){

	if (!step) step = 10;
	if (!size) size = 1000;

	var grid = new THREE.GridHelper( size, step, 0x444444, 0x444444 );

	grid.name = name || "GRID";
	grid.position.y = 0;

	return grid;
}

