CustomAxisHelper = this;

var distance = 5200;

this.add.apply( this, helper( distance ) );

function helper( distance ){

	var geometryX = new THREE.Geometry();
	var geometryY = new THREE.Geometry();
	var geometryZ = new THREE.Geometry();

	var materialX = new THREE.LineBasicMaterial( {color: 0xff0000} );
	var materialY = new THREE.LineBasicMaterial( {color: 0x00ff00} );
	var materialZ = new THREE.LineBasicMaterial( {color: 0x0000ff} );

	geometryX.vertices.push( new THREE.Vector3( -distance, 0, 0 ), new THREE.Vector3( distance, 0, 0 ) );
	geometryY.vertices.push( new THREE.Vector3( 0, -distance, 0 ), new THREE.Vector3( 0, distance, 0 ) );
	geometryZ.vertices.push( new THREE.Vector3( 0, 0, -distance ), new THREE.Vector3( 0, 0, distance ) );

	var axisX = new THREE.Line( geometryX, materialX );
	var axisY = new THREE.Line( geometryY, materialY );
	var axisZ = new THREE.Line( geometryZ, materialZ );

	return [ axisX, axisZ ];

}
